import Vue from 'vue'
import App from './App.vue'

Vue.config.productionTip = false

// new Vue({
//   render: h => h(App),
// }).$mount('#app')

	const Counter = {
	  data() {
	    return {
	      counter: 0
	    }
	  },
	  mounted() {
	      setInterval(() => {
	        this.counter++
	      }, 1000)
	    }
	}
	
	Vue.createApp(Counter).mount('#counter')
